ttp://localhost/icybernet/wp-admin/\">bng tin</a>  xa trang ny v to trang mi cho ni dung ca chnh bn. Chc bn vui v!</p>\n<!-- /wp:paragraph -->','Trang Mu','','publish','closed','open','','Trang mu','','','2022-09-11 10:34:34','2022-09-11 10:34:34','',0,'http://localhost/icybernet/?page_id=2',0,'page','',0),(3,1,'2022-09-11 10:34:34','2022-09-11 10:34:34','<!-- wp:heading --><h2>Chng ti l ai</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Vn bn c  xut: </strong>a ch website l: http://localhost/icybernet.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Bnh lun</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Vn bn c  xut: </strong>Khi khch truy cp  li bnh lun trn trang web, chng ti thu thp d liu c hin th trong biu mu bnh lun v cng l a ch IP ca ngi truy cp v chui user agent ca ngi dng trnh duyt  gip pht hin spam</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Mt chui n danh c to t a ch email ca bn (cn c gi l hash) c th c cung cp cho dch v Gravatar  xem bn c ang s dng n hay khng. Chnh sch bo mt ca dch v Gravatar c ti y: https://automattic.com/privacy/. Sau khi chp nhn bnh lun ca bn, nh tiu s ca bn c hin th cng khai trong ng cnh bnh lun ca bn.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Vn bn c  xut: </strong>Nu bn ti hnh nh ln trang web, bn nn trnh ti ln hnh nh c d liu v tr c nhng (EXIF GPS) i km. Khch truy cp vo trang web c th ti xung v gii nn bt k d liu v tr no t hnh nh trn trang web.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Vn bn c  xut: </strong>Nu bn vit bnh lun trong website, bn c th cung cp cn nhp tn, email a ch website trong cookie. Cc thng tin ny nhm gip bn khng cn nhp thng tin nhiu ln khi vit bnh lun khc. Cookie ny s c lu gi trong mt nm.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Nu bn vo trang ng nhp, chng ti s thit lp mt cookie tm thi  xc nh nu trnh duyt cho php s dng cookie. Cookie ny khng bao gm thng tin c nhn v s c g b khi bn ng trnh duyt.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Khi bn ng nhp, chng ti s thit lp mt vi cookie  lu thng tin ng nhp v la chn hin th. Thng tin ng nhp gn nht lu trong hai ngy, v la chn hin th gn nht lu trong mt nm. Nu bn chn &quot;Nh ti&quot;, thng tin ng nhp s c lu trong hai tun. Nu bn thot ti khon, thng tin cookie ng nhp s b xo.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Nu bn sa hoc cng b bi vit, mt bn cookie b sung s c lu trong trnh duyt. Cookie ny khng cha thng tin c nhn v ch n gin bao gm ID ca bi vit bn  sa. N t ng ht hn sau 1 ngy.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Ni dung nhng t website khc</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Vn bn c  xut: </strong>Cc bi vit trn trang web ny c th bao gm ni dung c nhng (v d: video, hnh nh, bi vit, v.v.). Ni dung c nhng t cc trang web khc hot ng theo cng mt cch chnh xc nh khi khch truy cp  truy cp trang web khc.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Nhng website ny c th thu thp d liu v bn, s dng cookie, nhng cc trnh theo di ca bn th ba v gim st tng tc ca bn vi ni dung c nhng , bao gm theo di tng tc ca bn vi ni dung c nhng nu bn c ti khon v  ng nhp vo trang web .</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Chng ti chia s d liu ca bn vi ai</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Vn bn c  xut: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>D liu ca bn tn ti bao lu</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Vn bn c  xut: </strong>Nu bn  li bnh lun, bnh lun v siu d liu ca n s c gi li v thi hn. iu ny l  chng ti c th t ng nhn ra v chp nhn bt k bnh lun no thay v gi chng trong khu vc i kim duyt.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>i vi ngi dng ng k trn trang web ca chng ti (nu c), chng ti cng lu tr thng tin c nhn m h cung cp trong h s ngi dng ca h. Tt c ngi dng c th xem, chnh sa hoc xa thng tin c nhn ca h bt k lc no (ngoi tr h khng th thay i tn ngi dng ca h). Qun tr vin trang web cng c th xem v chnh sa thng tin .</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cc quyn no ca bn vi d liu ca mnh</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Vn bn c  xut: </strong>Nu bn c ti khon trn trang web ny hoc   li nhn xt, bn c th yu cu nhn tp xut d liu c nhn m chng ti lu gi v bn, bao gm mi d liu bn  cung cp cho chng ti. Bn cng c th yu cu chng ti xa mi d liu c nhn m chng ti lu gi v bn. iu ny khng bao gm bt k d liu no chng ti c ngha v gi cho cc mc ch hnh chnh, php l hoc bo mt.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>D liu ca bn c gi n u</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Vn bn c  xut: </strong>Cc bnh lun ca khch (khng phi l thnh vin) c th c kim tra thng qua dch v t ng pht hin spam.</p><!-- /wp:paragraph -->','Chnh sch bo mt','','draft','closed','open','','chinh-sach-bao-mat','','','2022-09-11 10:34:34','2022-09-11 10:34:34','',0,'http://localhost/icybernet/?page_id=3',0,'page','',0),(6,1,'2022-09-11 10:47:41','2022-09-11 10:47:41','','Ca hng','','publish','closed','closed','','cua-hang','','','2022-09-11 10:47:41','2022-09-11 10:47:41','',0,'http://localhost/icybernet/cua-hang/',0,'page','',0),(7,1,'2022-09-11 10:47:41','2022-09-11 10:47:41','<!-- wp:shortcode -->[woocommerce_cart]<!-- /wp:shortcode -->','Gi hng','','publish','closed','closed','','gio-hang','','','2022-09-11 10:47:41','2022-09-11 10:47:41','',0,'http://localhost/icybernet/gio-hang/',0,'page','',0),(8,1,'2022-09-11 10:47:41','2022-09-11 10:47:41','<!-- wp:shortcode -->[woocommerce_checkout]<!-- /wp:shortcode -->','Thanh ton','','publish','closed','closed','','thanh-toan','','','20